#include <iostream>
#include <vector>
#include <queue>
#include <algorithm>

using namespace std;

int main() {
    int rows = 25;
    int cols = 30;

    vector<vector<char>> grid(rows, vector<char>(cols));

    // Input the grid
    for (int i = 0; i < rows; ++i) {
        for (int j = 0; j < cols; ++j) {
            cin >> grid[i][j];
        }
    }

    if (grid[0][0] == 'X') {
        cout << "infeasible" << endl;
        return 0;
    }

    if (grid[rows - 1][cols - 1] == 'X') {
        cout << "infeasible" << endl;
        return 0;
    }

    queue<pair<int, int>> q;
    q.push({0, 0});

    vector<vector<bool>> visited(rows, vector<bool>(cols, false));
    visited[0][0] = true;

    vector<vector<char>> parent(rows, vector<char>(cols, ' '));

    int dr[] = {-1, 1, 0, 0};
    int dc[] = {0, 0, -1, 1};

    while (!q.empty()) {
        pair<int, int> curr = q.front();
        q.pop();

        if (grid[curr.first][curr.second] == '#') {
            string path = "";
            int r = curr.first;
            int c = curr.second;

            while (r != 0 || c != 0) {
                char p = parent[r][c];
                path = p + path;
                if (p == 'U') {
                    r--;
                } else if (p == 'D') {
                    r++;
                } else if (p == 'L') {
                    c--;
                } else {
                    c++;
                }
            }
            cout << path << endl;
            return 0;
        }

        for (int i = 0; i < 4; ++i) {
            int nr = curr.first + dr[i];
            int nc = curr.second + dc[i];

            if (nr >= 0 && nr < rows && nc >= 0 && nc < cols &&
                grid[nr][nc] != 'X' && !visited[nr][nc]) {
                q.push({nr, nc});
                visited[nr][nc] = true;
                parent[nr][nc] = grid[curr.first][curr.second];
            }
        }
    }

    cout << "infeasible" << endl;

    return 0;
}
